import React from 'react'
import LogementList from '../Home/logements.json'


export default function Card () {
    return (
        <div className='cardApp'>
        { 
            LogementList.map( logement => {
                return(
                    <div className="box" key={ Card.id }>
                   { logement.title }
                      </div>
                )
            })
        }
   </div> )
}
